import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import "./staff.css";

const event1 = () => {
  return (
    <div className='event1'>
    <p className='text-center'>IT STAFF AUGMENTATION SERVICES
    </p>
    <h1 className='text-center'>Now you don't have to <strong>hire, train and manage</strong> an entire in-house development team</h1>
    </div>
  );
}

export default event1;

